import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  const [blogs, setBlogs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [editing, setEditing] = useState(null);
  const [editTitle, setEditTitle] = useState('');
  const [editContent, setEditContent] = useState('');

  useEffect(() => {
    const fetchBlogs = async () => {
      try {
        const token = localStorage.getItem('token');
        const res = await axios.get('http://localhost:5000/api/blogs', {
          headers: { Authorization: `Bearer ${token}` }
        });
        setBlogs(res.data);
      } catch (err) {
        console.error(err);
      } finally {
        setLoading(false);
      }
    };
    fetchBlogs();
  }, []);

  const handleDelete = async (id) => {
    if (window.confirm('Are you sure you want to delete this blog?')) {
      try {
        const token = localStorage.getItem('token');
        await axios.delete(`http://localhost:5000/api/blogs/${id}`, {
          headers: { Authorization: `Bearer ${token}` }
        });
        setBlogs(blogs.filter(blog => blog._id !== id));
      } catch (err) {
        console.error(err);
      }
    }
  };

  const handleEdit = (blog) => {
    setEditing(blog._id);
    setEditTitle(blog.title);
    setEditContent(blog.content);
  };

  const handleUpdate = async (id) => {
    try {
      const token = localStorage.getItem('token');
      const response = await axios.put(`http://localhost:5000/api/blogs/${id}`, {
        title: editTitle,
        content: editContent,
      }, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setBlogs(blogs.map(blog => blog._id === id ? response.data : blog));
      setEditing(null);
    } catch (err) {
      console.error(err);
    }
  };

  const handleCancel = () => {
    setEditing(null);
    setEditTitle('');
    setEditContent('');
  };

  if (loading) return <p>Loading...</p>;

  return (
    <div>
      <h2>My Dashboard</h2>
      <Link to="/add-blog" className="btn">Add New Blog</Link>
      <h3>My Blogs</h3>
      {blogs.length === 0 ? (
        <p>You haven't created any blogs yet.</p>
      ) : (
        blogs.map(blog => (
          <div key={blog._id} className="card">
            {editing === blog._id ? (
              <div>
                <input
                  type="text"
                  value={editTitle}
                  onChange={(e) => setEditTitle(e.target.value)}
                  placeholder="Title"
                  className="input"
                />
                <textarea
                  value={editContent}
                  onChange={(e) => setEditContent(e.target.value)}
                  placeholder="Content"
                  className="textarea"
                />
                <button onClick={() => handleUpdate(blog._id)} className="btn">Update</button>
                <button onClick={handleCancel} className="btn" style={{ marginLeft: '10px', backgroundColor: '#ccc' }}>Cancel</button>
              </div>
            ) : (
              <div>
                <h3>{blog.title}</h3>
                <p>{blog.content.substring(0, 100)}...</p>
                <p>By: {blog.author.username}</p>
                <p>Created: {new Date(blog.createdAt).toLocaleDateString()}</p>
                <Link to={`/blog/${blog._id}`} className="btn">View</Link>
                <button onClick={() => handleEdit(blog)} className="btn" style={{ marginLeft: '10px' }}>Edit</button>
                <button onClick={() => handleDelete(blog._id)} className="btn" style={{ marginLeft: '10px', backgroundColor: '#ff0000' }}>Delete</button>
              </div>
            )}
          </div>
        ))
      )}
    </div>
  );
};

export default Dashboard;
